import cl from "./Button.module.css";



export const Button = ({
  children = "Click me",
  type,
  size,
  variant,
  disabled
}) => {

  return (
    <button
      className={[cl.button, cl[size], cl[variant], cl[type]].join(" ")}
      disabled={true}
      >
      {children}
    </button>
  );
};
